package com.ursful.framework.database.base.model;import java.util.Date;import java.io.Serializable;import com.ursful.framework.database.annotaion.RdColumn;import com.ursful.framework.database.annotaion.RdTable;//测试模型@RdTable(name = "T_TEST_MODEL")public class TestModel implements Serializable{    private static final long serialVersionUID = 1L;    //创建日期 (NULL)    public static final String T_CREATE_DATE = "createDate";    //编号 (NOT NULL)    public static final String T_ID = "id";    //名称 (NOT NULL)    public static final String T_NAME = "name";    @RdColumn(name = "CREATE_DATE")    private Date createDate;    private Date startCreateDate;    private Date endCreateDate;    @RdColumn(name = "ID", unique = true)    private String id;    @RdColumn(name = "NAME")    private String name;    public Date getCreateDate(){        return this.createDate;    }    public void setCreateDate(Date createDate){        this.createDate = createDate;    }    public Date getStartCreateDate(){        return this.startCreateDate;    }    public void setStartCreateDate(Date startCreateDate){        this.startCreateDate = startCreateDate;    }    public Date getEndCreateDate(){        return this.endCreateDate;    }    public void setEndCreateDate(Date endCreateDate){        this.endCreateDate = endCreateDate;    }    public String getId(){        return this.id;    }    public void setId(String id){        this.id = id;    }    public String getName(){        return this.name;    }    public void setName(String name){        this.name = name;    }}